(function () {
  var module = angular.module('loom_server_service', []);
  var servers = [];
  var rootScope_ = null;
  var dialogService_ = null;
  var translate_ = null;
  var http_ = null;
  module.provider('serverService', function () {
    this.$get = [
      '$rootScope',
      '$http',
      '$location',
      '$translate',
      'dialogService',
      function ($rootScope, $http, $location, $translate, dialogService) {
        rootScope_ = $rootScope;
        dialogService_ = dialogService;
        translate_ = $translate;
        http_ = $http;
        return this;
      }
    ];
    this.getServers = function () {
      return servers;
    };
    this.getServerByIndex = function (index) {
      var server = null;
      if (!goog.isDefAndNotNull(index)) {
        throw {
          name: 'serverService',
          level: 'High',
          message: 'undefined server index.',
          toString: function () {
            return this.name + ': ' + this.message;
          }
        };
      }
      if (index >= 0 && index < servers.length) {
        server = servers[index];
      }
      return server;
    };
    this.getServerById = function (id) {
      var server = null;
      if (!goog.isDefAndNotNull(id)) {
        throw {
          name: 'serverService',
          level: 'High',
          message: 'undefined server id.',
          toString: function () {
            return this.name + ': ' + this.message;
          }
        };
      }
      for (var index = 0; index < servers.length; index += 1) {
        if (servers[index].id === id) {
          server = servers[index];
          break;
        }
      }
      return server;
    };
    this.getServerByName = function (name) {
      var server = null;
      if (!goog.isDefAndNotNull(name)) {
        throw {
          name: 'serverService',
          level: 'High',
          message: 'undefined server name.',
          toString: function () {
            return this.name + ': ' + this.message;
          }
        };
      }
      for (var index = 0; index < servers.length; index += 1) {
        if (servers[index].name.toLocaleLowerCase() === name.toLowerCase()) {
          server = servers[index];
          break;
        }
      }
      return server;
    };
    this.addServer = function (serverInfo) {
      var server = {
          id: servers.length,
          ptype: 'gxp_olsource',
          config: serverInfo
        };
      goog.object.extend(server, serverInfo, {});
      console.log('---- adding server: ', server);
      servers.push(server);
      return server.id;
    };
    this.populateLayers = function (index) {
      var server = servers[index];
      if (!goog.isDefAndNotNull(server)) {
        return [];
      }
      if (!goog.isDefAndNotNull(server.layers) && goog.isDefAndNotNull(server.url)) {
        console.log('Sending GetCapabilities.server: ', server, ', index:', index);
        server.layers = [];
        var parser = new ol.parser.ogc.WMSCapabilities();
        var url = server.url + '?SERVICE=WMS&REQUEST=GetCapabilities';
        http_.get(url).then(function (xhr) {
          if (xhr.status == 200) {
            var response = parser.read(xhr.data);
            if (goog.isDefAndNotNull(response.capability) && goog.isDefAndNotNull(response.capability.layers)) {
              server.layers = response.capability.layers;
              for (var index = 0; index < server.layers.length; index += 1) {
                server.layers[index].added = false;
              }
              rootScope_.$broadcast('layers-loaded');
            }
          } else {
            dialogService_.error(translate_('error'), translate_('failed_get_capabilities') + ' (' + xhr.status + ')');
            server.layers = [];
          }
        }, function (xhr) {
          dialogService_.error(translate_('error'), translate_('failed_get_capabilities') + ' (' + xhr.status + ')');
          server.layers = [];
        });
      }
      return server.layers;
    };
    this.refreshLayers = function (index) {
      var server = servers[index];
      if (goog.isDefAndNotNull(server) && goog.isDefAndNotNull(server.layers)) {
        var parser = new ol.parser.ogc.WMSCapabilities();
        var url = server.url + '?SERVICE=WMS&REQUEST=GetCapabilities';
        http_.get(url).then(function (xhr) {
          if (xhr.status == 200) {
            var response = parser.read(xhr.data);
            if (goog.isDefAndNotNull(response.capability) && goog.isDefAndNotNull(response.capability.layers)) {
              var serverLayers = [];
              var index;
              for (index = 0; index < server.layers.length; index += 1) {
                if (server.layers[index].added) {
                  serverLayers.push(server.layers[index]);
                }
              }
              var layers = response.capability.layers;
              for (index = 0; index < layers.length; index += 1) {
                for (var subIndex = 0; subIndex < serverLayers.length; subIndex += 1) {
                  if (serverLayers[subIndex].title === layers[index].title) {
                    layers[index].added = true;
                    break;
                  }
                }
                if (!goog.isDefAndNotNull(layers[index].added)) {
                  layers[index].added = false;
                }
              }
              server.layers = layers;
              rootScope_.$broadcast('layers-loaded');
            }
          } else {
            dialogService_.error(translate_('error'), translate_('failed_get_capabilities') + ' (' + xhr.status + ')');
          }
        }, function (xhr) {
          dialogService_.error(translate_('error'), translate_('failed_get_capabilities') + ' (' + xhr.status + ')');
        });
      }
      return server.layers;
    };
  });
}());
(function () {
  var module = angular.module('loom_arrangeable_directive', []);
  module.directive('loomArrangeable', function () {
    return {
      restrict: 'C',
      link: function (scope, element, attrs) {
        $(function () {
          var startIndex = -1;
          var config = {
              onDragStart: function ($item, container, _super) {
                var height = $item.outerHeight();
                var width = $item.outerWidth();
                var offset = $item.offset(), pointer = container.rootGroup.pointer;
                startIndex = $item.index();
                adjustment = {
                  left: pointer.left - offset.left,
                  top: pointer.top - offset.top
                };
                _super($item, container);
                $item.css({
                  width: width,
                  height: height
                });
              },
              onDrag: function ($item, position) {
                $item.css({
                  left: position.left - adjustment.left,
                  top: position.top - adjustment.top
                });
              },
              onDrop: function ($item, container, _super) {
                scope.$eval(attrs.arrangeableCallback)(startIndex, $item.index());
                _super($item);
              },
              distance: 5
            };
          if (attrs.arrangeableHandle) {
            config.handle = attrs.arrangeableHandle;
          }
          if (attrs.arrangeableItemSelector) {
            config.itemSelector = attrs.arrangeableItemSelector;
          }
          if (attrs.arrangeablePlaceholder) {
            config.placeholder = attrs.arrangeablePlaceholder;
          }
          if (attrs.arrangeableDragDistance) {
            config.distance = attrs.arrangeableDragDistance;
          }
          element.sortable(config);
        });
      }
    };
  });
}());
